import React from "react";
import styled from "styled-components";
import Categories from "../assets/categories.jpg";

function Second() {
  return (
    // <Wrapper>
    <div
      style={{
        backgroundImage: "url(" + Categories + ")",
        paddingTop: 50,
        padding: 50,
        paddingBottom: 50,
        backgroundPosition: "center",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        width: "100vw",
        height: "100vh",
      }}
      className="jumbotron jumbotron-fluid"
      className="text-right p-5"
    >
      <div className="container">
        <h2 className="display-4" className="text-right pr-5 pt-5 mt-5">
          Lets find you a photographer
        </h2>
        <p className="lead medium" className="text-center pr-5 mt-1">
          Choose the categories you wish to browse <br />
        </p>
        <a a className="btn btn-outline-light text-center mr-2 mt-2" href="#">
          Search
        </a>
      </div>
    </div>
    // </Wrapper>
  );
}

export default Second;
